import React, { useEffect,useState } from 'react';
impo
function Book() {
  const [Doctor, setDoctor] = useState("");
    useEffect(() => {
        fetch("/dataload")
        .then((response) => response.json())
        .then((data) => {
          console.log(data);
          setDoctor(data)
        })
        .catch((error) => {
          console.error(error);
        });
      }, []);
    return(
        <div className="App">
      {Doctor.map((doctor, index) => (
            <div key={doctor._id}>
              {doctor.name}
              {doctor.message}
            </div>
        ))}
        </div>
    );
}
export default Book;
